import { makeStyles } from '@material-ui/core/styles';
import useWindowDimensions from '../utils/screen';

function EmptySpace() {
    let { heigth } = useWindowDimensions();
    console.log(heigth);
    return heigth;
}

const BodyStyle = makeStyles((theme) => ({
    body: {
        backgroundColor: 'green',
        flexGrow: 1,
        height: '80vh',
        marginTop:'10px'
    },
}));

export default BodyStyle;
